import classes from "./Skills.module.css";
import Container from "react-bootstrap/esm/Container";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Skills = () => {
    return ( 

        <section className={classes.skills}>
            <Container>
                <h3 className={classes.skills__header}>Competencies</h3>
                <Row>
                    <Col>
                        <h6>Certifications</h6>
                    </Col>
                    <Col>
                        <h6>Skills</h6>
                        <p>Programming Languages: Python, Java, JavaScript, C, SQL</p>
                        <p>Libraries/Frameworks: React.js, Vue.js, Express.js, Material-UI, Bootstrap</p>
                        <p>Misc: AWS, Azure, CSS, HTML, PostgreSQL, Unix, Git, Jenkins</p>
                    </Col>
                </Row>
            </Container> 
        </section>
     );
}

export default Skills;
